import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Search for products to trigger filter functionality
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');

    // Wait for search results to load
    await page.waitForSelector('.results-count', { timeout: 5000 });

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_search.png'));

    // Apply price range filter
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.fill('#minPrice', '100');
    await page.fill('#maxPrice', '500');
    await page.click('.apply-filter');

    // Wait for filter to be applied
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_filter.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_filter.png'));

    // Extract product data to verify filter was applied
    const extractedData = await page.$$eval('.product-card', products => {
      return products.map(product => {
        const priceText = product.querySelector('.product-price').textContent;
        const price = parseFloat(priceText.replace(/[^\d.]/g, ''));
        return {
          title: product.querySelector('.product-title').textContent.trim(),
          price: price
        };
      });
    });

    return {
      success: true,
      action: "Applied price range filter of $100-$500 to electronics search results",
      extractedData: {
        filteredProducts: extractedData,
        productCount: extractedData.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
